import matplotlib.pyplot as plt
import pandas as pd

def analyze_ga_results(csv_file_path):
    # load CSV file into DataFrame
    df = pd.read_csv(csv_file_path)

    # ensure correct data types
    df["Crossover Rate"] = df["Crossover Rate"].astype(float)
    df["Mutation Rate"] = df["Mutation Rate"].astype(float)
    df["Best Distance"] = df["Best Distance"].astype(float)
    df["Execution Time (s)"] = df["Execution Time (s)"].astype(float)
    df["Generations"] = df["Generations"].astype(int)
    df["Tournament Size"] = df["Tournament Size"].astype(int)
    df["Population Size"] = df["Population Size"].astype(int)

    # print interesting statistics
    print("Best Distance: ", df["Best Distance"].min())
    print("Average Best Distance: ", df["Best Distance"].mean())
    print("Worst Best Distance: ", df["Best Distance"].max())
    print("Best Execution Time: ", df["Execution Time (s)"].min())
    print("Longest Execution Time: ", df["Execution Time (s)"].max())
    print("Average Execution Time: ", df["Execution Time (s)"].mean())

    print("Worst parameters: ")
    worst_params = df[df["Best Distance"] == df["Best Distance"].max()]
    print(worst_params.to_string())

    print("Best parameters: ")
    best_params = df[df["Best Distance"] == df["Best Distance"].min()]
    print(best_params.to_string())

    # average fitness for each mutation rate
    avg_fitness = df.groupby("Mutation Rate")["Best Distance"].mean().reset_index()
    plt.figure(figsize=(10, 5))
    plt.plot(avg_fitness["Mutation Rate"], avg_fitness["Best Distance"], label="Avg Distance", color="blue")
    plt.xlabel("Mutation Rate")
    plt.ylabel("Distance")
    plt.title("Average Distance over Mutation Rate")
    plt.legend()
    plt.grid()
    plt.show()

    # average fitness for each crossover rate
    avg_fitness = df.groupby("Crossover Rate")["Best Distance"].mean().reset_index()
    plt.figure(figsize=(10, 5))
    plt.plot(avg_fitness["Crossover Rate"], avg_fitness["Best Distance"], label="Avg Distance", color="blue")
    plt.xlabel("Crossover Rate")
    plt.ylabel("Distance")
    plt.title("Average Distance over Crossover Rate")
    plt.legend()
    plt.grid()
    plt.show()

    # average fitness for each population size
    avg_fitness = df.groupby("Population Size")["Best Distance"].mean().reset_index()
    plt.figure(figsize=(10, 5))
    plt.plot(avg_fitness["Population Size"], avg_fitness["Best Distance"], label="Avg Distance", color="blue")
    plt.xlabel("Population Size")
    plt.ylabel("Distance")
    plt.title("Average Distance over Population Size")
    plt.legend()
    plt.grid()
    plt.show()

# Function to analyze and visualize a single TSP instance
def analyze_tsp_instance(name, generations, best_distance, best_route, avg_distances):
    plt.figure(figsize=(10, 5))
    plt.plot(range(1, len(avg_distances) + 1), avg_distances, label="Avg Distance", color="blue")
    plt.xlabel("Generation")
    plt.ylabel("Distance")
    plt.hlines(best_distance, 1, generations, label="Best Distance", color="red")
    plt.title("Average Distance over Generations for TSP " + name)
    plt.legend()
    plt.grid()
    plt.show()
    
